ISLAMABAD, Feb 9 (APP): Independent candidate, Muhammad Arqam Khan has won the election for Punjab Assembly constituency PP-68, Gujranwala-X by securing 43,615 votes.
According to the unofficial result issued by the Returning Officer/ECP, his runner-up was Pakistan Muslim League (N) candidate, Chaudhary Muhammad Iqbal who bagged 40,311 votes. The votersâ€™ turn-out remained 53.32%.
